INSERT INTO `noticias` VALUES (1,'SE PONE EN MARCHA EL XVII TORNEO NACIONAL DE FUTBOL INFANTIL!!','El pasado viernes 10 de Enero a las 11hs se realizo una conferencia de prensa en el salon de fiesta del club Atletico Ayacucho, en el cual se lanzo el 17 Torneo Nacional de Futbol Infantil que estara reservado para las clase 2007 y junto a el, se realizara el Torneo Paralelo para la clase 2009. Cabe mencionar que estan confirmadas las presencias de los mas prestigiosas instituciones del futbol de A.F.A. y Nacional de Uruguay. Los esperamos!!','Noticia1','2020-01-12'),(2,'TRISTE NOTICIA','Es dificil incorporar noticias que no quisieramos compartir y que nos han sorprendido tristemente. El tragico fallecimiento de Nicolas Trabella en estas ultimas horas, quien venia entrenando con el plantel 2007, con sus escasos 12 aos para jugar el XVII Torneo Nacional de Futbol Infantil. Sus compaeros y profes estan intentando superar el duelo porque hay que continuar. La familia albirroja acompaa a la famila Trabella en este dificil momento.','Noticia2','2020-02-05'),(3,'SE REALIZo EL SORTEO DE ZONAS DEL TORNEO NACIONAL DE FUTBOL INFANTIL!!','El pasado 8 de febrero desde las 20hs, se desarrollo el sorteo del Torneo Nacional sub-12 y del Torneo Paralelo sub-10 en nuestro salon que posee nuestra institucion, por lo que quedaron definidos los grupos en ambas categorias. En estos dias se publicara el cronograma de los partidos con las canchas y horarios correspondientes.','Noticia3','2020-02-08'),(4,'POSTERGADA LA INAUGURACIoN!!','Debido a inconevientes climaticos, la ceremonia inaugural se reprogramo para el dia viernes a las 19:50 hs. Ademas, se completaran durante el transcurso de la maana, aquellos partidos que el clima impidio que se realicen.','Noticia4','2020-02-13'),(5,'INAUGURACIoN OFICIAL!!','Luego de la postergacion por el mal clima del pasado jueves, se realizo la ceremonia inaugural con la presencia de los equipos participantes. En la misma se realizo un homenaje a Nicolas, jugador N3 del equipo anfitrion, quien perdiera la vida en un accidente dias atras. En un acto muy emotivo, por pedido de sus compaeros y decision de la comision directiva, se hizo entrega de su camiseta a la familia, ante un interminable aplauso del publico presente, la cual sera retirada durante la temporada actual.','Noticia5','2020-02-15'),(6,'VELEZ CAMPEON!!!','El Club Atletico Velez Sarsfield se consagro campeon del XVII Torneo Nacional de Futbol Infantil - Ciudad de Ayacucho -, tras vencer 2 a 1 en una final pareja, al Club Atetico Talleres de Cordoba. En cuanto al torneo paralelo categoria 2009, el campeon fue Gimnasia de Tandil, que vencio en los penales 5 a 3 a Alumni Azuleo, luego de empatar en 0 en los 60 minutos reglamentarios de la final. Salud campeones!!','Noticia6','2020-02-16'),(7,'UN AO MaS!!','Finalizo el XVII Torneo Nacional de Futbol Infantil. El Club Atletico Ayacucho agradece a todos aquellos, que de una manera u otra colaboran para que el torneo se realice con total exito. Agradece tambien a todos los equipos participantes, haciendo una mension especial a Talleres de Cordoba, Andes Talleres de Mendoza y Club Nacional de Futbol de Uruguay, por lo gran cantidad de kilometros recorridos, lo que engrandece nuestro torneo. La comision directiva se siente orgullosa por el trabajo realizado. Esperamos el ao proximo volver a encontrarnos y contar con la presencia de mas equipos.','Noticia7','2020-02-16'),(8,'La previa: antes del torneo','El pasado jueves se realizo en las instalaciones de nuestra institucion el sorteo para la organizacion de zonas que difinieron los enfrentamientos. La categoria 2009 luchara para quedarse con la nueva Copa Challenge.','Noticia8','2022-01-29'),(9,'Arranco el campeonato','Finalizando el martes, alrededor de las 21 hs., arribo a las puertas de la institucion del Albirrijo la primer delegacion. Luego de varias hora de viaje, se hizo presente Talleres de Cordoba, que un ao mas nos acompaa en el Torneo Nacional de Futbol Infantil - Ciudad de Ayacucho.','Noticia9','2022-02-08'),(10,'Velez y Talleres campeones','En el ultimo dia de competencia, Talleres se consagro campeon en la cetegoria 2008, la cual se disputo este año debido al conocido parate por la pandemia. Luego de una final muy pareja con Banfield que finalizo 1 a 1 en el tiempo reglamentario, fue la T quien se quedo con el campoenato tras una infartante definicion por penales por 9 a 8. Por su parte, el fortin fue quien se llevo el campeonato en la categoria 2009 luego de vencer a boca por 2 tantos contra 0.','Noticia10','2022-02-13'),(11,'Se realizo el sorteo','En el dia de ayer se realizo el sorteo de los grupos para el Torneo Nacional y Torneo Paralelo, como asi tambien el de la categoria Femenino. Ya quedo menos para que gire la pelota sobre el cesped. Los esperamos a todos desde el primero al cinco de febrero!','Noticia11','2023-01-20'),(12,'Comenzo el torneo!','Luego de una larga jornada, se completaron los resultados del dia 1, donde todas las miradas estuvieron en el partido interzonal que disputaron San Lorenzo y Estudiantes de La Plata. En un partido muy parejo con llegadas para ambos lados, y en el cual la lluvia tuvo un papel muy importante, fue 0 a 0 el resultado final. Mañana continuaremos con mas futbol y tambien con la Inauguracion oficial si la lluvia lo permite.. PH: DesorienteBlues','Noticia12','2023-02-01'),(13,'Jornada completa','A pesar de la intensa lluvia caida por la mañana, pudo completarse con normalidad todos los partidos del dia. Agredecemos a toda la gente que se hizo presente en los distintos escenarios. En el dia de mañana se completan los partidos de zonas y se definiran los cruces a jugarse el dia sabado! PH: DesorienteBlues','Noticia13','2023-02-02'),(14,'Finalizo la inauguracion','Se completo con exito la Inauguracion oficial con una masiva presencia del publico. En la misma participaron la mayoria de los equipos del certamen, con la excepcion de aquellos clubes de la zona que viajan todos los dias. Mañana continuamos con mas futbol!!','Noticia14','2023-02-02'),(15,'Finalizada la anteúltima jornada','Se completaron todos los partidos del día y quedaron definidos todos los cruces para el dia domingo. En categoria 2010, la primer semifinal la protagonizaran Ferrocarril Oeste contra Talleres de Cordoba desde las 10 de la mañana. Mientras que 11:15 hs. trataran de acceder a la final Independiente y San Lorenzo. PH: DesorienteBlues','Noticia15','2023-02-04'),(17,'San Lorenzo campeon!!','El ciclon se consagro campeon del XIX Torneo Nacional de Futbol Infantil Ciudad de Ayacucho. Luego de una final pareja, era San Lorenzo quien buscaba un poco mas el arco rival, hasta que finalmente en los ultimos minutos del partido llego el gol que le da su primer torneo Ciudad de Ayacucho. En el resto de los torneo paralelos, Atletico Ayacucho se cosagro campeon en la categoria 2011, Independiente de Tandil fue el campeon en la categoria 2012, Atletico Las Flores se corono en 2013, mientras que el Leon se llevo el torneo femenino Categoria 2008. Salud campeones y los esperamos a todos el año que viene!!','Noticia17','2023-02-06'),(18,'Atletico Ayacucho campeon Categoria 2011','El Club Atletico Ayacucho se quedo con la Copa de Oro en la categoria 2011 luego de una excelente campaña, en la que vencio al Leon de Madariaga en la final desde los penales. Cuando Atletico se preparaba para gritar campeon en el tiempo reglamentario, ya que, si bien era una final pareja, parecia tener controlada, llego el empate del Leon en el ultimo minuto. Fue entonces desde los penales donde pudo inponerse Atletico convirtiendo todos sus penales, y con el arquero deteniendo un disparo. Felicitaciones a todos los chicos campeones y a disfrutar del titulo!','Noticia16','2023-02-05'),(19,'El diablito Echeverri al Manchester City','Claudio Echeverri, quien en 2019 disputó el Torneo Nacional Ciudad de Ayacucho, está a un paso de convertirse en nuevo jugador del Manchester City, que abonará una suma de alrededor de 25 millones de dólares y lo dejará cedido en River. Este domingo, en vísperas de Navidad, Fabrizio Romano confirmó que el Diablito firmará un contrato por seis años con el equipo de Pep Guardiola, aunque seguirá vistiendo los colores millonarios hasta diciembre de 2024.','Noticia18','2024-01-02'),(20,'Valentin Iriart en Banfield','El jugador del club Atlético, categoría 2010 quien disputara el último Torneo Nacional, hace horas arribó a la sede de Banfield, club perteneciente a la primera division del fútbol nacional, dónde fue incorporado para desarrollar la temporada 2024 en su categoría. Valentín será jugador de Banfield todo este temporada que está comenzando en el sur del gran Buenos Aires. Felicitaciones Valentín','Noticia19','2024-01-22'),(22,'Se definio el fixture','Quedaron definidos todos los partidos en todas las categorías. Con 90 equipos en competencias, seran muchos los partidos para disfrutar. A dos dias del comienzo, crece la ansiedad en los niños, mientras los organizadores ajustan los ultimos detalles.','Noticia20','2024-02-05'),(23,'Partidos reprogramados','Luego de completarse la primer jornada con un unico partido reprogramado, las lluvias durante la madrugada y mañana del jueves obligó a la Organización a reprogramar los dos primeros turnos de los distintos escenarios. La jornada comenzará a las 12:50 hs y los partidos reprogramados se avisara a los clubes involucrados. Cualquier modificacion se ira avisando por los distintos medios de comunicacion','Noticia21','2024-02-08'),(24,'Jornada completa','Luego de reprogramar los dos primeros turnos en todas las canchas, se pudo completar con normalidad el resto de la jornada con gran acompañamiento del publico en todos los escenarios. Mañana, si el tiempo acompaña, se cierran los partidos de grupo y con eso se definiran todos los partidos de la Copa de Oro y Copa de Plata que comienzan el dia sabado.','Noticia22','2024-02-08'),(25,'La Inauguracion fue un exito','Durante la nochecita del dia jueves, se realizo con total normalidad la ceremonia inaugural de la XX edicion del Torneo Nacional de Futbol Infantil Ciudad de Ayacucho. Con gran presencia de las delegaciones y del publico visitante se realizo la misma pasada las 20hs. Conto con la participacion de la murga Psicodelica Alegria, el tradicional desfile con todos los equipos y una coreografia con alumnos de la escuelita del Club Atletico Aycucho','Noticia23','2024-02-09'),(26,'Ultimo dia','A pesar de las complicaciones generadas por la intensa lluvia caida durante el dia viernes y madrugada del sabado, que dejo algunas canchas inutilizables por el resto del torneo, se pudo completar los partidos de zonas y comenzarse a disputar Copas de Oro y Plata en todas las categorias. En cuanto a la categoria 2011, bien tarde en la noche se cerro el ultimo cruce de octavos entre Independiente de Avellanadeda y el local Atletico Ayacucho con gran acompañamiento del publico. Hoy sera el ultimo dia y se definiran dos campeones de la XX edición, desicion que se tomo en conjunto con los equipos afistas debido las distintas reprogramaciones.','Noticia24','2024-02-11'),(27,'Sportivo Piazza campeon femenino 2008','El equipo de la ciudad de Azul se consagro en la categoria Femenino 2008 luego de vencer 1 a 0 Ferrocarril Roca de Las Flores en la final. Se hicieron el trofeo ganando todos los partidos del campeonato. Completaron las 4 primeras ubicaciones Juventud Unida de Ayacucho e Independiente de Tandil.','Noticia25','2024-02-11'),(28,'Alumni Azuleño campeon categoria 2013','En una final muy pareja que termino sin goles, fue Alumni quien se consagro en los penales en una larga definicion por 6 a 5. El Leon de Madariaga y Unicen Azul de Tandil se quedaron con el tercer y cuarto puesto. La copa de Plata de la categoria la gano Independiente de Mar del Plata que le gano 1 a 0 Los Patos de Balcarce en la final.','Noticia26','2024-02-11'),(29,'El Leon de Madariga campeon categoria 2012','El Leon se consagro campeon luego de derrotar 4 a 1 a Gimnasia de Tandil en la final. Ademas, Liniers de Bahia Blanca y Ferroviarios de Balcarce se quedaron con el tercer y cuarto puesto. La Copa de Plata se la quedo Racing de Olavarria que vencio 5 a 2 a Juventud Unida de Madariaga','Noticia27','2024-02-11'),(30,'Boca y River campeones 2024!!','En un torneo con muchisimas complicaciones climaticas, que obligo a la organizacion a tomar muchas decisiones sobre la marcha, una de ellas consensuadas con los equipos afistas, que por primera en el Torneo Nacional de Futbol Infantil Ciudad de Ayacucho tenga dos campeones. Es por ello que en el 2024 son Boca y River son los campeones del Torneo Nacional. Boca lo hizo luego de igualr en 1 con el pincha, en una larguisima definion por penales ganando por 12 a 11. Por su parte River vencio por 2 a 0 a Velez. En el partido por el quinto puesto, Talleres vencio por penales a Banfield. Ademas, River se quedo con la valla menos vencida del torneo, el premio al juego limpio y con el goleador, Jorge Sosa con 14 goles. En la Copa de Plata el campeon fue Racing de Olavarria luego de vencer 1 a 0 a Ferrocarril Roca de Las Flores.','Noticia28','2024-02-11'),(31,'Se lanzó la XXI edición','El pasado 30 de diciembre, se realizó el lanzamiento oficial de la edición XXI del Torneo Nacional de Futbol Infantil Ciudad de Ayacucho, con la presencia del Intendente Municial y el acompañamiento del público albirrojo. El certamen contará con aproxadamente 90 equipos y se realizará del 5 al 9 de febrero del 2025','Noticia29','2025-01-02');
